fields.description:
Mutation for deleting a workbook based on its ID and organization ID.

Fields:
    - work_book (WorkBookType): The deleted workbook object.
    - message (str): A success or error message indicating the result of the deletion operation.

Arguments:
    - id (int): The unique identifier for the workbook to be deleted.
    - organization_id (UUID): The UUID of the organization that owns the workbook.

Usage:
    mutation {
        deleteWorkBook(id: 1, organizationId: "some-uuid") {
            message
            workBook {
                id
                name
                // other fields
            }
        }
    }

